import React, { useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";

const Navbar = () => {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [user, setUser] = useState(null); // Простое состояние для теста

  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));

  const toggleDrawer = (open) => {
    setDrawerOpen(open);
  };

  const pages = [
    { id: 1, title: "Атлеты", link: "/athletes" },
    { id: 2, title: "Виды спорта", link: "/sports" },
    { id: 3, title: "Медальный зачет", link: "/medal-table" },
  ];

  if (user && user.email === "admin@example.com") {
    pages.push({ id: 4, title: "Админ", link: "/admin" });
  }

  return (
    <div style={styles.root}>
      <AppBar position="static" style={styles.appBar}>
        <Toolbar style={styles.toolbar}>
          <div style={styles.leftItems}>
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Flag_of_Kyrgyzstan_%283-2%29.svg/1599px-Flag_of_Kyrgyzstan_%283-2%29.svg.png?20240311163127"
              style={styles.icon}
              alt="Flag"
            />
            <Typography variant="h6" style={styles.menuItem}>
              Спортсмены КР
            </Typography>
          </div>

          {!isMobile && (
            <div style={styles.centerItems}>
              {pages.map((page, index) => (
                <IconButton
                  key={page.id}
                  color="inherit"
                  style={styles.menuButton}
                >
                  <Typography variant="body1" style={styles.menuItem}>
                    {page.title}
                  </Typography>
                </IconButton>
              ))}
            </div>
          )}

          <div style={styles.rightItems}>
            <Typography
              variant="body1"
              style={{ color: "#ffffff", marginRight: "15px" }}
            >
              {user
                ? `Добро пожаловать, ${user.email}`
                : "Добро пожаловать, гость"}
            </Typography>
            <IconButton
              edge="end"
              color="inherit"
              aria-label="menu"
              onClick={() => toggleDrawer(true)}
            >
              <MenuIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="right"
        open={drawerOpen}
        onClose={() => toggleDrawer(false)}
        style={styles.drawer}
        transitionDuration={500}
      >
        <div style={styles.drawerHeader}>
          <IconButton
            onClick={() => toggleDrawer(false)}
            style={styles.closeButton}
          >
            <CloseIcon />
          </IconButton>
        </div>
        <List style={styles.drawerList}>
          <ListItem button>
            <Typography style={{ color: "#000000" }}>
              {user
                ? `Добро пожаловать, ${user.email}`
                : "Добро пожаловать, гость"}
            </Typography>
          </ListItem>
          {!user && (
            <ListItem button>
              <ListItemText primary="Регистрация" />
            </ListItem>
          )}
          {user && (
            <ListItem button onClick={() => setUser(null)}>
              <ListItemText primary="Выйти" />
            </ListItem>
          )}
          {pages.map((page) => (
            <ListItem button key={page.id}>
              <ListItemText primary={page.title} />
            </ListItem>
          ))}
        </List>
      </Drawer>
    </div>
  );
};

const styles = {
  root: {
    flexGrow: 1,
    width: "100%",
    height: "auto",
    overflow: "hidden",
  },
  appBar: {
    backgroundColor: "#1a1a1a",
    color: "#ffffff",
    overflow: "hidden",
  },
  toolbar: {
    display: "flex",
    justifyContent: "space-between",
  },
  leftItems: {
    display: "flex",
    alignItems: "center",
  },
  centerItems: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    flex: 1,
  },
  rightItems: {
    display: "flex",
    alignItems: "center",
  },
  menuButton: {
    marginRight: 10,
  },
  menuItem: {
    color: "#ffffff",
  },
  icon: {
    width: "auto",
    height: 40,
    marginRight: 10,
  },
  drawerList: {
    width: 250,
  },
  drawerHeader: {
    display: "flex",
    justifyContent: "flex-end",
    padding: "10px",
  },
  closeButton: {
    color: "#000",
  },
  drawer: {
    backgroundColor: "rgba(0, 0, 0, 0.9)",
  },
};

export default Navbar;
